@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("dictionary.com"),
domain("reference.com"),
domain("thesaurus.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, footer, #de, #dmain, #q, .frb, .fcnxt, .dicTl, .shd_hdr, #cwrp, #ss_slf, .rh, .dym, .spellLd, #nfotr, #nfr, .hdrQuery, #bk, #hd, #tx, #fotr, .box, .hd, #leftRail, .srs, .tr_titleStyle, .tr_subtext, .ht, .tr_mod, .dCounter, .shths, .b2, .potd, .gT, #gC, .gcdiv, #gC span, .botAd, .ttext, div.b1, #txt, #tabr1, .estt, #taw1, #est1, .tab, #dyk, #qtil, #qotc, #qun, #fqun, #fqt, #mlrs, .qtb, #qtts, #qttp, #hlin a:hover, #wrapper, #boxIn3, div.input-box span, div.luna-Ent, span.ital-inline, span.sectionLabel, .body .pg, .body .secondary-bf, .tail, .tail .rom-inline, .secondary-bf, .main .container, .query_h1, .queryn, span.boldface, span.pron, div#wrp, div.rcr, div.body, #contouter, .aa, div#qtd, .qt, div.ad, div.af, div.ffc, div#zd, div#z0, div#z1, div#z2, span.com, div.brw, div.rightRail_content, div#rightRail, span.quote_span, div.address, span.trust_text, div.trgt, .gc, .hwl, .rwh, .ihdr, .qhdr, .ptn, .bllt, #sftr, span#hotword

{
color: white !important;
background: black !important;
border: black !important;
}

select, input, span, code, textarea, pre, label, div, dd, .wiac, .wia

{
color: white !important;
}

select, #hlin a.sel, #hlin

{
background: black !important;
}

div, span, a

{
background-color: black !important;
}

/*links*/

a, .hwc, #hlin a.sel

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code #macnt

{
background: #333333 !important;
}

}
